		function resultFeedbackMessage(){

		            }

		function captureSubmittedCards() {

		    const sourceCards = this.selectedCards[roundIdx];
		    // 1. Initialize the correct slot in lastCurrentCards (CRITICAL FIX FOR LEVEL 2)
		    if (this.roundNum === 2) {
		        // Level 2 structure must be a multi-array: [[Orange], [Blue], [Purple]]
		        this.lastCurrentCards[roundIdx] = [[], [], []];
		    } else {
		        // Level 1/3 structure: [cards]
		        this.lastCurrentCards[roundIdx] = []; 
		    }
		    // 2. Iterate through the selected cards (MovieClip objects) and capture their type string
		    if (Array.isArray(sourceCards[0])) {
		        // Level 2: Multi-array Source (sourceCards is [[O], [B], [P]])
		        for (let i = 0; i < sourceCards.length; i++) {
		            // i=0 is Orange, i=1 is Blue, i=2 is Purple.
		            // Both sourceCards[i] and this.lastCurrentCards[roundIdx][i] are arrays of cards for that color.
		            for (let j = 0; j < sourceCards[i].length; j++) {
		                const cardObj = sourceCards[i][j];
		                const cardType = cardObj._cardType;
		                const parsed = parsePointsAndCost(cardType);
		                totalPoints += parsed.points;
		                totalCost += parsed.cost;
		                // PUSH IS NOW SAFE: lastCurrentCards[roundIdx][i] is guaranteed to be []
		                this.lastCurrentCards[roundIdx][i].push(cardType); 
		            }
		        }
		    } else {
		        // Level 1/3: Single array Source
		        for (let i = 0; i < sourceCards.length; i++) {
		            const cardType = sourceCards[i]._cardType;
		            const parsed = parsePointsAndCost(cardType);
		            totalPoints += parsed.points;
		            totalCost += parsed.cost;
		            this.lastCurrentCards[roundIdx].push(cardType); 
		        }
		    }
		    // 3. Update the final results (points and cost)
		    this.lastCurrentPoints[roundIdx] = String(totalPoints);
		    this.lastCurrentCost[roundIdx] = String(totalCost);
			this.lastCurrentTime[roundIdx] = this.timerCurrent;

		        if (Array.isArray(levelCards[0])) {

		            // Results exist if ANY of the nested arrays has a length > 0

		function layoutCards(panel, cardsArr, tweenTime, scrollY) {

		function addScrollbarToPanel(panel, cardsArray, scrollYState, visibleRowsOverride) {

		function addVerticalScrollbar(maskObj, contentObj, maskWidth, maskHeight, contentHeight, scrollState) {
		    if (maskObj._vScrollbarTrack) maskObj.removeChild(maskObj._vScrollbarTrack);
		    if (maskObj._vScrollbar) maskObj.removeChild(maskObj._vScrollbar);
		    if (contentHeight <= maskHeight) {
		        scrollState.value = 0;
		        contentObj.y = 0;
		        return;
		    }
		    var scrollbarWidth = 10;
		    var scrollbarMargin = 0; 
		    var trackHeight = maskHeight - 2 * scrollbarMargin;
		    var scrollbarX = maskWidth - scrollbarWidth;
		    var scrollbarY = scrollbarMargin;
		    var scrollThumbMinHeight = 40;
		    var scrollbarTrackColor = window.scrollbarTrackColor || "#E7E6E6";
		    var scrollbarBarColor = window.scrollbarBarColor || "#C2C1C1";
		    var maxScroll = contentHeight - maskHeight;
		    var barHeight = Math.max(scrollThumbMinHeight, (maskHeight / contentHeight) * trackHeight);

		        .drawRoundRect(scrollbarX, scrollbarY, scrollbarWidth, barHeight, scrollbarWidth / 2);
		    vScrollbar.cursor = "pointer";
		    maskObj.addChild(vScrollbar);

		    function updateThumbAndContent(scrollY) {
		        scrollY = Math.max(0, Math.min(scrollY, maxScroll));

		        dragging = true;
		        var mouseGlobalY = evt.stageY / stage.scaleY;

		// --- Core Event Handler (RESTORED and UPDATED) ---
		function clickFunction(e){
		    //console.log("Button Click " + e.currentTarget.name);
		    switch(e.type){
		        case "mouseover":
		        case "mouseout":
		            break;
		        case "click":
		            switch(e.currentTarget.name){
		                case "btn_skip":
		                case "btn_start":
		                    stopAllVO.call(this); 
		                    this.currentPage = "Play";
		                    this.currentInitialPage = 0;
		                    this.currentResultInitialPage = 0;
		                    this.gotoAndPlay("transition");
							if (this.obj_level2CostBreakDown) this.obj_level2CostBreakDown.visible = (this.roundNum === 2);
		                    break;
		                case "btn_yes":
		                    stopAllVO.call(this);
		                    this.obj_prompts.gotoAndPlay("out");
		                    if (this.promptAction == "Menu") {
		                        this.currentPage = "Menu";
		                        this.restartCards();
		                        this.gotoAndPlay("results");
		                    } else if (this.promptAction == "Restart") {
		                        this.restartCards();
		                    } else if (this.promptAction == "Submit") {
								captureSubmittedCards.call(this);
		                        this.currentPage = "Results";
		                        this.gotoAndPlay("results");
		                    }
							this.obj_results.obj_levelSelection.visible = false;
		                    break;
		                case "btn_no":
		                    stopAllVO.call(this);
		                    this.currentPage = "Play";
		                    this.obj_prompts.gotoAndPlay("out");
		                    this.playTimer();
		                    break;
		                case "btn_continue":
		                    stopAllVO.call(this);
							this.obj_prompts.gotoAndPlay("out");
							if (this.promptAction == "Pause") {
								this.isPlaying = !this.isPlaying;
								this.btn_pp.mcIcon.gotoAndStop(!this.isPlaying ? 1 : 0);
								this.playTimer();
		                        this.obj_timer.obj_clock.gotoAndPlay();
		                        this.obj_logo.edaLogo.gotoAndPlay();
		                        if(!this.isMuted && this.bgMusic && typeof this.bgMusic.play === 'function'){ this.bgMusic.play(); }
							}else{
								captureSubmittedCards.call(this);
								this.currentPage = "Results";
								this.gotoAndPlay("results");
								this.obj_results.obj_levelSelection.visible = false;
							}
		                    break;
		                case "btn_Home":
		                    stopAllVO.call(this);
							updateResultButtonState.call(this, this.roundNum);
							updateMenuLevelButtons.call(this);
		                    if(this.currentPage == "Play"){
		                        this.callPrompt("Menu");
		                    }else if (this.currentPage == "Results"){
		                        this.currentPage = "Menu";
		                        this.gotoAndPlay("exit");
							}else if(this.currentPage == "How"){
								this.removeVideoFromStage(this.obj_pages.obj_how2); 
								this.obj_pages.obj_how2.visible = false;
								this.currentPage = "Menu";
		                        this.gotoAndPlay("transition");
		                    }else{
								// hleader board
		                        this.currentPage = "Menu";
		                        this.gotoAndPlay("transition");
		                    }
		                    this.currentInitialPage = 0;
							showHideActionItem.call(this, true);
							updateResultSelectionButtons.call(this);
							updateIndicatorForContainer.call(this, this.obj_pages.obj_menu);
		                    break;
		                case "btn_submit":
		                    this.callPrompt("Submit");
		                    break;
		                case "btn_restart":
		                    this.callPrompt("Restart");
		                    break;
		                case "btn_dismiss":
		                    this.obj_Oprompt.gotoAndPlay("out");
		                    break;
		                case "btn_play":
		                    stopAllVO.call(this);
		                    this.currentPage = "Round" + this.roundNum;
		                    this.txt_stageRound.txt_gRound.text = "Level " + this.roundNum;
							console.log("replace round number to Level " + this.roundNum)
		                    this.gotoAndPlay("transition");
		                    this.currentInitialPage = 0;
		                    whichLevel.call(this, this);
							playVO.call(this, this.roundNum, 0, 3);
		                    break;
						case "btn_how":
							stopAllVO.call(this);
		                    this.currentPage = "How";
		                    this.gotoAndPlay("transition");
		                    break;
						case "btn_results":
							stopAllVO.call(this);
							if(!e.currentTarget.noResultsYet.visible){
								this.obj_results.obj_levelSelection.visible = true;
								showHideActionItem.call(this, false);
								this.currentResultsPage = this.obj_results['obj_result' + this.roundNum];
								updateResultSelectionButtons.call(this);
								updateIndicatorForContainer.call(this, this.obj_results.obj_levelSelection);
								this.currentPage = "Results";
								this.gotoAndPlay("transition");
							}else{
								return;
							}
		                    break;
						case "btn_leaderBoard":
		                    stopAllVO.call(this);
							this.currentPage = "LeaderBoard";
		                    this.gotoAndPlay("transition");
		                    break;
		                case "btn_next":
		                    stopAllVO.call(this); 
		                    if(this.currentInitialPage != this.totalPage[this.roundNum-1]){
		                        this.currentInitialPage++;
		                    }
		                    this.currentRoundPage.gotoAndPlay("in" + this.currentInitialPage);
		                    playVO.call(this, this.roundNum, this.currentInitialPage, 0); 
		                    break;
		                case "btn_back":
		                    stopAllVO.call(this);
							this.currentRoundPage.gotoAndPlay("out" + this.currentInitialPage);
		                    if(this.currentInitialPage != 0){
		                        this.currentInitialPage--;
		                    }
		                    playVO.call(this, this.roundNum, this.currentInitialPage, 0); 
		                    break;
		                case "btn_rNext":
		                    if(this.currentResultInitialPage != this.totalRPage[this.roundNum-1]){
		                        this.currentResultInitialPage++;
		                    }
		                    this.currentResultsPage.gotoAndStop(this.currentResultInitialPage);

		                        this.currentResultInitialPage--;

		                    this.currentPage = "Round" + this.roundNum;
		                    this.gotoAndPlay("exit");
		                    moveSelectedEffectTo.call(this, this.roundNum, false);
							this.txt_stageRound.txt_gRound.text = "Level " + this.roundNum;
							playVO.call(this, this.roundNum, 0, 3.5);
		                    break;
		                case "btn_mute":
		                    this.isMuted = !this.isMuted;
		                    this.bgMusic.muted = this.isMuted;
		                    this.btn_mute.mcIcon.gotoAndStop(this.isMuted ? 1 : 0);
		                    createjs.Sound.setMute(this.isMuted); 
		                    stage.update();
							//  NEW: Mute/Unmute the embedded HTML video
							const mcContainer = this.obj_pages.obj_how2;
							//const mcContainer = this.obj_how2;
							if (mcContainer && mcContainer._htmlVideoElement) {
								mcContainer._htmlVideoElement.muted = this.isMuted;
								// If unmuting the video, we might need to kick off its playback again 
								// if it was paused due to autoplay policy.
								if (!this.isMuted) {
									mcContainer._htmlVideoElement.play().catch(e => {
										console.log("Video playback resume failed after unmute.", e);
									});
								}
							}
		                    if (!this.isMuted && this.bgMusic.paused) this.bgMusic.play();
		                    break;
		                case "btn_pp":
							this.callPrompt("Pause");
		                    this.isPlaying = !this.isPlaying;
		                    this.btn_pp.mcIcon.gotoAndStop(!this.isPlaying ? 1 : 0);
		                    if (this.isPlaying){
		                        this.playTimer();
		                        this.obj_timer.obj_clock.gotoAndPlay();
		                        this.obj_logo.edaLogo.gotoAndPlay();
		                        if(!this.isMuted && this.bgMusic && typeof this.bgMusic.play === 'function'){ this.bgMusic.play(); }
		                    }else{
		                        this.pauseTimer();
		                        this.obj_logo.edaLogo.gotoAndStop();
		                        if (this.bgMusic && typeof this.bgMusic.pause === 'function') {
		                            this.bgMusic.pause();
		                        }
		                    }
		                    break;
		                default:
		                    break;
		            }
		            break;
		        default:
		            break;
		    }
			if (e.type === "click") {
		        this.playSoundEffect(this, this.sfx.click);
		    }
		}
		// Function: embedVideoToContainer (FINAL VERSION: Centering Setup)
		this.embedVideoToContainer = function(mcContainer, videoID, loadQueue) {
		    if (!mcContainer || !mcContainer.nominalBounds) {
		        console.error("Video container MC not found or lacks nominalBounds.");
		        return;
		    }
		    const videoData = loadQueue.getItem(videoID);
		    if (!videoData) {
		        console.error("Video asset was not loaded by the specified queue:", videoID);
		        return;
		    }
		    // --- 1. Create Video Element ---
		    const videoElement = document.createElement('video');
		    videoElement.id = 'videoPlayer-' + videoID;
		    videoElement.className = 'absolute-video';
		    videoElement.src = videoData.src;
		    videoElement.controls = true;      
		    videoElement.autoplay = false; 
		    videoElement.playsInline = true; 
		    videoElement.loop = false;
		    videoElement.muted = this.isMuted; 
		    // --- CRITICAL CENTERING CSS SETUP ---
		    // Apply initial position and the transform for centering.
		    videoElement.style.position = 'absolute'; 
		    videoElement.style.transform = 'translate(-50%, -50%)'; // <-- CRITICAL for centering
		    videoElement.style.transformOrigin = 'center center';   // <-- Ensures scaling is from the center
		    const canvasParent = stage.canvas.parentElement || document.body;
		    canvasParent.appendChild(videoElement);
		    mcContainer._htmlVideoElement = videoElement;
		    // --- (Rest of the mute sync and delay logic remains here) ---
		    // ...
